#include "../HMM/HMM.h"

void testWeather() {
	char hiddenStateName[][10] = {
		"sun",
		"cloud",
		"rain"
	};
	EFTYPE hiddenStateRate[] = {
		1.0,
		0,
		0
	};

	EFTYPE hiddenStateTrans[][3] = {
		{
			0.5, 0.375, 0.125
		}, {
			0.25, 0.125, 0.625
		}, {
			0.25, 0.375, 0.375
		}
	};

	char shownStateName[][10] = {
		"dry",
		"dryish",
		"damp",
		"soggy"
	};
	EFTYPE shownStateTrans[][4] = {
		{
			0.6, 0.2, 0.15, 0.05
		}, {
			0.25, 0.25, 0.25, 0.25
		}, {
			0.05, 0.10, 0.35, 0.5
		}
	};

	HMM hmm;
	for (int i = 0; i < 3; i++) {
		hmm.hidden.addState(hiddenStateName[i], 1);
	}
	for (int i = 0; i < 3; i++) {
		hmm.hidden.makeRate(hiddenStateName[i], hiddenStateName[i + 1], hiddenStateRate[i]);
	}
	for (int i = 0; i < 3; i++) {
		for (int j = 0; j < 3; j++) {
			hmm.hidden.makeTransRate(hiddenStateName[i], hiddenStateName[j],
				hiddenStateTrans[i][j]);
		}
	}
	for (int i = 0; i < 4; i++) {
		hmm.shown.addState(shownStateName[i]);
	}
	for (int i = 0; i < 3; i++) {
		for (int j = 0; j < 4; j++) {
			hmm.makeConfusionRate(hiddenStateName[i], shownStateName[j],
				shownStateTrans[i][j]);
		}
	}


	//TEST
	hmm.printCurrentRate();
	hmm.printTransitionRate();
	hmm.printTransitionBackRate();
	hmm.printObversableStates();
	hmm.printConfusionRate();
	hmm.printConfusionBackRate();

	printf("Test OK\n");

	hmm.addObversableResult("dry");
	hmm.addObversableResult("damp");
	hmm.addObversableResult("soggy");
	hmm.addObversableResult("soggy");
	hmm.addObversableResult("damp");
	hmm.addObversableResult("damp");
	hmm.addObversableResult("dry");
	hmm.addObversableResult("dry");
	hmm.addObversableResult("dry");
	hmm.addObversableResult("dry");
	hmm.addObversableResult("dry");
	hmm.addObversableResult("dry");
	hmm.addObversableResult("dry");
	hmm.addObversableResult("damp");

	HMMState * state = hmm.observe.link;
	HMMState * start = hmm.observe.prev(state);
	Connector * max_trans;
	state = start;
	if (state) {
		do {

			if (state == start) {
				max_trans = NULL;
				EFTYPE max = 0;
				Connector * conn = state->trace.link;
				if (conn) {
					do {

						if (max < conn->weight) {
							max = conn->weight;
							max_trans = conn;
						}

						conn = state->trace.next(conn);
					} while (conn && conn != state->trace.link);
				}
			}
			else {
				Connector * conn = state->trace.link;
				if (conn) {
					do {

						if (max_trans->back == conn->forw) {
							max_trans = conn;
							break;
						}

						conn = state->trace.next(conn);
					} while (conn && conn != state->trace.link);
				}
			}

			state->prob = max_trans && max_trans->forw ? max_trans->forw : NULL;

			state = hmm.observe.prev(state);
		} while (state && state != start);
	}

	//display observe result
	state = hmm.observe.link;
	printf("\nResult: ");
	if (state) {
		do {

			printf("%s(%s)->", state->name, state->prob ? state->prob->name : "Unknown");

			state = hmm.observe.next(state);
		} while (state && state != hmm.observe.link);
	}

	_getch();

}
